        t_centers_state = 0
        set_x_centers_555 = self.set_x_centers_555
        set_t_centers_555 = self.set_t_centers_555

        for x in LFRB_centers_555:
            cubie_state = parent_state[x]

            if x in set_x_centers_555:

                if cubie_state == 'L':
                    x_centers_state = x_centers_state | 0x1
